// add menu-mobile--switcher-btn placeholder

(function placeholderMenuMobileSwitcher() {

    // находим кнопку, открывающую меню

    var switchBtn = document.querySelectorAll('.js-menu-mobile .menu-top__switcher')[0];

    // клонируем кнопку переключалку

    var clone = switchBtn.cloneNode(true);

    // добавляем ей класс

    clone.classList.add('header-middle__switch-btn');

    // добавляем обработчик, который свяжет клик на клона с кликом на реальную кнопку

    clone.addEventListener('click', function () {

        document.querySelectorAll('.menu-top .menu-top__switcher-btn')[0].click();

    });

    // находим элемент, после которого нужно вставить кнопку

    var appendAfterElement = document.querySelectorAll('.js-logo-header')[0];

    // вставляем

    appendAfterElement.parentNode.insertBefore(clone,appendAfterElement.nextSibling);

})();


(function sliderHeader() {
    var sliderHeader = {
        root:     $(".js-slider-header"),
        carousel: $(".js-slider-header .js-slider"),
        nextBtn:  $(".js-slider-header .js-nav-next"),
        prevBtn:  $(".js-slider-header .js-nav-prev"),
        counter:  $(".js-slider-header .js-nav-counter"),
        animation: 'flipInX'
    };

    if ( sliderHeader.carousel.find('.item').length > 1 ){

        // animateOut: 'slideOutDown',
        // animateIn: 'flipInX',

        sliderHeader.carousel.on('init', function(e, slick) {
            renderCounter(slick.slideCount, 1);
            sliderHeader.root.addClass('is-initialized');
        });
        sliderHeader.carousel.on('beforeChange', function(e, slick, currentSlide, nextSlide) {
            renderCounter(slick.slideCount, nextSlide+1);
        });

        sliderHeader.carousel.slick({
            autoplay: true,
            autoplaySpeed: 4000,
            infinite: true,
            arrows: false,
            dots: false,
            fade: true,
            speed: 400
        });

        function renderCounter(slideCount, nextSlide) {
            sliderHeader.counter.html( nextSlide + '/' + slideCount);
        }

        sliderHeader.nextBtn.click(function() {
            sliderHeader.carousel.slick('slickNext');
        });
        sliderHeader.prevBtn.click(function() {
            sliderHeader.carousel.slick('slickPrev');
        });

    } else {
        sliderHeader.nextBtn.remove();
        sliderHeader.prevBtn.remove();
    }

}());

(function advantages() {
    var advantages = {
        carousel : $(".js-advantages .owl-carousel"),
        nextBtn : $(".js-advantages .js-nav-next"),
        prevBtn : $(".js-advantages .js-nav-prev")
    };
    $(advantages.carousel).imagesLoaded()
        .always( function( instance ) {
            advantages.carousel.owlCarousel({
                nav: false,
                dots: false,
                loop: true,
                items: 4,
                responsive : {
                    0: { items: 1},
                    480: { items: 2},
                    768: { items: 3},
                    1024: { items: 4}
                }
            });
            advantages.nextBtn.click(function() {
                advantages.carousel.trigger('next.owl.carousel');
            });
            advantages.prevBtn.click(function() {
                advantages.carousel.trigger('prev.owl.carousel');
            });
        })
        .fail( function() {
            console.warn('one or more images is broken in ' + advantages.carousel.selector);
        });

}());
